import "./nav.css"

function Nav() {
  return (
    <nav className="navBar">
      <nav href='/'>Books Swap</nav>
      <div className="right-links">
      <nav href='/'>Available books</nav>
      <nav href='/claimed'>Claimed books</nav>
      <nav href='#'>Add book</nav>
      </div>
    </nav>

  )
}

export default Nav;
